import React from 'react';

const MovieDetails=({movie})=>{
    if(!movie){
        return null;
    }
    return (
        <div className='movie-details'>
            <h2>{movie.name}</h2>
            <p>Release Year: {movie.releaseYear}</p>
            <p>Director: {movie.director}</p>
            <p>Language: {movie.language}</p>
        </div>
    )
}

export default MovieDetails;
